import React, { Component } from "react"

import Botao from "./Botao"
import Exibir from "./Exibir"

export default class MegaSena extends Component {

    state = {
        gerar: false,
        numeros: []
    }

    gerarNumeros = () => {
        console.log(Math.random(1, 5))
    }

    render() {
        return (
            <div>
                <h2>Mega-Sena</h2>

                <Botao gerar={this.gerarNumeros}></Botao>
                <Exibir></Exibir>
            </div>
        )
    }
}
